import React from 'react';
import withData from '../../with-data';

const TestUserProfile = ({data, name, email }) => {
    <div className='container'>
        <h1>{name}</h1>
        <h2>{email}</h2>

        {this.data.map(post => (
            <div className='post' key={post.id}>
                <h1>{post.title}</h1>
                <p>{post.body}</p>
            </div>
        ))}
    </div>  
}
export default withData(TestUserProfile, 'https://jsonplaceholder.typicode.com/posts')
